import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Navbar from './components/layouts/Navbar';
import Home from './components/pages/Home';
import Socket from './components/pages/Socket';
import Header from './components/components/Header';
import Maps from './components/components/Maps';
import Footer from './components/components/Footer'
import {useState , useEffect} from 'react'
import io from "socket.io-client";
const socket = io();

function App() {
	const [robotTime, setrobotTime] = useState("");
	const [robotStatus, setrobotStatus] = useState("");
	const [robotMode, setrobotMode] = useState("");
	const [robotDriver, setrobotDriver] = useState("");
	const [cpu , setCpu] = useState('')
	const [ram , setRam] = useState('')
	const [temp , setTemp] = useState('')
	const [battery , setBattery] = useState('')
	useEffect(() => {
		console.log("Emiting")
		socket.on('robotStatus',data=>{
			setrobotStatus(data)
		})
		socket.on("FromAPI", data => {
			setrobotTime(data);
		});
		socket.on('robotMode',data => {
			setrobotMode(data)
		})
		socket.on('robotDriver', data => {
			setrobotDriver(data)
		})
		socket.on('cpuUsage', data => {
			setCpu(data)
		})
		socket.on('ramUsage', data => {
			setRam(data)
		})
		socket.on('temp', data => {
			setTemp(data)
		})
		socket.on('battery', data => {
			setBattery(data)
		})
	  }, [robotTime]);
	return (

		<Router>

			<Switch>
				<Route exact path='/'>
					{' '}
					<div >
				<Navbar />
			</div>
					<Header time={robotTime} 
					robotDriver={robotDriver}
					 robotMode={robotMode} 
					 robotStatus={robotStatus} 
					 cpu={cpu}  ram={ram} temp ={temp} battery={battery} />
					<Home />
					<Footer/>
				</Route>
					<Route exact path='/map'>
					<Maps />
					</Route>
				<Route exact path="/test" >
					<Socket/>
				</Route>
			</Switch>

		</Router>
	);
}

export default App;
